import React, { Component } from 'react';
import QuotationPage from './component/QuotationPage';
import './App.css';

class App extends Component {
  state = {
        quotations: []
      };
  componentDidMount() {
    fetch('https://testreact-backend.herokuapp.com')
    .then(res => res.json())
    .then((data) => {
      this.setState({ quotations: data })
    })
    .catch(console.log)
  }

  render() {
    return (
      <QuotationPage />
    );
  }
}

export default App;
